import Status from './../Status/Status'
import { useState } from 'react';
import TextInput from './../TextInput/TextInput';
import styles from './PeopleInput.module.scss'

const PeopleInput = () => {
  const [peopleMax, setPeopleMax] = useState('');
  const [peopleSitting, setPeopleSitting] = useState('');


  if (<Status value="Cleaning" /> || <Status value="Free" />)
    return (
      <div>
        <label className={styles.paramtitle}>People:</label> <TextInput value="0" />
        <span>/</span>
        <TextInput value="0" />
      </div>
    )
  else
    return (
      <div>
        <label className={styles.paramtitle}>People:</label> <TextInput onChange={e => setPeopleSitting(e.target.value)} />
        <span>/</span>
        <TextInput onChange={e => setPeopleMax(e.target.value)} />
      </div>

    )
}

export default PeopleInput;
